RHO = 100 # radius of the earth, default to 100  
def convert_to_cartesian_cosine(point):
  # NB: not sure why these are negative, but proportions are off otherwise
  lat = -math.radians(point[0])
  lon = -math.radians(point[1])
  x = math.cos(lat) * math.cos(lon) * RHO
  y = math.cos(lat) * math.sin(lon) * RHO
  z = math.sin(lat) * RHO # z is 'up'
  return (x, y, z)

def cart_haversine(point):
  p = LatLon(point[0], point[1])
  nv = p.toNvector()
  return (nv.x * RHO, nv.y * RHO, nv.z * RHO)

def calc_arc(pts):
  cart_pts = map(lambda x: LatLon(x[0], x[1]).toNvector(), pts)
  return degrees(cart_pts[0].angleTo(cart_pts[1])) / 2.0

def calc_dist(pts):
  p1 = pts[0]
  p2 = pts[1]
  l1 = LatLon(p1[0], p1[1])
  l2 = LatLon(p2[0], p2[1])
  return l1.distanceTo(l2, radius=RHO)


def calc_midpt(pts, normalize=False):
  p1 = pts[0]
  p2 = pts[1]
  l1 = LatLon(p1[0], p1[1])
  l2 = LatLon(p2[0], p2[1])
  mpt = l1.midpointTo(l2)
  return (mpt.lat, mpt.lon)

# calculate the rotation to some points (calculates the midpt and rotates to that)
def calc_rotation_to(pts, base=(0,1,0)):
  midpt = calc_midpt(pts, normalize=True)
  midpt = cart_haversine(midpt)
  p1 = Nvector(base[0], base[1], base[2])
  p2 = Nvector(midpt[0], midpt[1], midpt[2])
  a = p1.cross(p2)
  quat_w = math.sqrt( (p1.length**2) * (p2.length**2) ) + p1.dot(p2)
  q = datatypes.Quaternion(a.x, a.y, a.z, quat_w)
  q.normalizeIt()
  er = q.asEulerRotation()
  return [er.x * 360, er.y * 360, er.z * 360]
  # return transform

def project_point(name, pt):
  cart_p = cart_haversine(pt)
  # print name, cart_p
  spaceLocator(n=name, p=cart_p)

def project_points(cable_id):
  points = []
  for idx, latitude in data['latitude'].iteritems():
      longitude = data['longitude'][idx]
      cables = data['cables'][idx]
      cable_ids = map(lambda x: x['id'], cables)
      # if search_id in cable_ids:
      if cable_id in cable_ids:
        points.append((latitude, longitude))

  for idx, point in enumerate(points):
    # print cart_haversine(point)
    project_point(cable_id + '_' + str(idx), point)
  return points

def get_points(cable_id, cart=False):
  points = []
  for idx, latitude in data['latitude'].iteritems():
      longitude = data['longitude'][idx]
      cables = data['cables'][idx]
      cable_ids = map(lambda x: x['id'], cables)
      # if search_id in cable_ids:
      if cable_id in cable_ids:
        points.append((latitude, longitude))
  if cart:
    points = map(cart_haversine, points)
  return points

project_points('tata-tgn-atlantic')

